import './index.css';

function TodoMenu({ todos, setTodos }) {
   function filterActivesTodos() {
      console.log("HOla")
      const newTodos = todos.filter(todo => !todo.completed);
      setTodos(newTodos);
   }

   function filterCompletedTodos() {
      console.log("HOla")
      const newTodos = todos.filter(todo => !todo.completed);
      setTodos(newTodos);
   }

   return (
      <nav className="TodoMenu">
         <button className="TodoMenuItem" onClick={filterActivesTodos}>Active</button>
         <button className="TodoMenuItem">Completed</button>
         <button className="TodoMenuItem">ALL</button>
      </nav>
   );
}

export { TodoMenu };
